description:
Planning application for part outline and part detail planning permission for:
(a) demolition of existing wholesale Fruit and Vegetable and Flower Market and ancillary buildings and structures, and residential building on Nine Elms Lane (apart from the existing multi storey car park);
(b) Construction of mixed-use redevelopment comprising: a new Fruit and Vegetable Market and Flower Market and ancillary uses, including temporary and permanent faade; refurbishment and extension of existing waste collection area (including rooftop sports pitches); residential dwellings; flexible commercial uses, including retail, financial and professional services, caf/restaurant, bar uses and hot food takeaways and offices; non-residential institutions; assembly and leisure uses; temporary storage and distribution buildings and associated works; associated car, cycle and motorcycle parking and servicing and new vehicle accesses, energy centres; and landscaping public realm and open space including part of the Linear Park. All matters reserved apart from access, details of all new markets and supporting buildings, and details of Building N8 and associated landscaping);
(c) Site clearance and enabling works.
An Environmental Statement has been submitted with the application under The Town and Country Planning (Environmental Impact Assessment) Regulations 2011.

