Condition : 35 - No development shall commence in each Phase until a Construction and Environmental Management Plan (CEMP) for that Phase has been submitted to and been approved in writing by the Local Planning Authority.  The construction management plan shall then be reviewed and updated prior to commencement of development in each Floorspace Phase. In particular the CEMP shall take account of market tenants and new residents within the development, and an updated version submitted to the Local Planning Authority for approval prior to commencement of development in each Phase unless it is agreed in writing by the Local Planning Authority that no amended version is warranted.  The CEMP shall include specific details for:-
a) the control of construction noise and vibration during hours of noisy activities (noise levels to be limited to those predicted in the Environmental Statement (April 2014) and Environmental Statement Addendum (September 2014)) ; 
b) a construction waste and material management, transportation and disposal strategy, including construction delivery booking and construction vehicle holding arrangements, and targets and arrangements for maximising the use of the river for material removal and material delivery where feasible;
c) air quality measures for the control and monitoring of dust, fine particles and odours;
d) construction traffic routing through the area and the site and the development site, including details of signage and an enforcement system for breach of its provisions;
e) a low emission strategy for construction traffic and machinery;
